package com.java.resource;

public class Challan {
	int sno,age;
	String name,sex,cell;
	public Challan() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Challan(int sno, int age, String name, String sex, String cell) {
		super();
		this.sno = sno;
		this.age = age;
		this.name = name;
		this.sex = sex;
		this.cell = cell;
	}
	@Override
	public String toString() {
		return "Challan [sno=" + sno + ", age=" + age + ", name=" + name
				+ ", sex=" + sex + ", cell=" + cell + "]";
	}
	public int getSno() {
		return sno;
	}
	public void setSno(int sno) {
		this.sno = sno;
	}
	public int getAge() {
		return age;
	}
	public void setAge(int age) {
		this.age = age;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getSex() {
		return sex;
	}
	public void setSex(String sex) {
		this.sex = sex;
	}
	public String getCell() {
		return cell;
	}
	public void setCell(String cell) {
		this.cell = cell;
	}
	
}
